function lineThrough(){
    let firstLi = document.querySelector('li')
    firstLi.style.textDecoration = "line-through"
}
lineThrough()

function setImg(id, url){
    let img = document.querySelector(`#${id}`)
    img.src = url
}
setImg("image-1", "data:image/jpeg;base64,")
setImg("image-2", "data:image/jpeg;base64,")
setImg("image-3", "data:image/jpeg;base64,")

function removeArgument(){
    let ul = document.querySelector("#arguments")
    let firstLi = ul.querySelector("li")
    firstLi.remove()
}
removeArgument()
removeArgument()

function changeSize(size, id){
    let item = document.querySelector(`#${id}`)
    item.style.fontSize = `${size}px`
}
changeSize(54, 'heading')

function addLi(domEl){
    let ul = document.querySelector('ul')
    ul.appendChild(domEl)
}
let img = document.createElement('img')
img.scr = "data:image/jpeg;base64,"
addLi(img)

function imgSize(domEl){
    domEl.style.height = '30px'
}
imgSize(img)

function makeInvisible(domEl){
    domEl.className = "invisible"
}
let lorem = document.querySelector('#lorem')
makeInvisible(lorem)

function liMaker(text){
    let li = document.createElement('li')
    li.innerText = text
    return li
}
let madeLi = liMaker("Made this!")
addLi(madeLi)

function headerMaker(size, text){
    let header = document.createElement(`h${size}`)
    header.innerText = text
    return header
}
let h3 = headerMaker(3, "Made this as well")
addLi(h3)